INSERT INTO blog_post VALUES(1,'Best smartwatch 2022: the top wearables you can buy today','2022-05-05 18:46:28','2022-10-30 15:21:10.548332','blog/posts/blog-1_Zx8UVMs.png',4,NULL,'best-smartwatch-2022-the-top-wearables-you-can-buy-today',2,23,replace(replace('<p>Helping everyone live happier, healthier lives at home through their kitchen. Kitchn is a daily food magazine on the Web celebrating life in the kitchen through home cooking and kitchen intelligence.</p>\r\n\r\n<p>We&#39;ve reviewed and ranked all of the best smartwatches on the market right now, and we&#39;ve made a definitive list of the top 10 devices you can buy today. One of the 10 picks below may just be your perfect next smartwatch.</p>\r\n\r\n<p>Those top-end wearables span from the Apple Watch to Fitbits, Garmin watches to Tizen-sporting Samsung watches. There&#39;s also Wear OS which is Google&#39;s own wearable operating system in the vein of Apple&#39;s watchOS - you&rsquo;ll see it show up in a lot of these devices.</p>\r\n\r\n<p>Lorem ipsum dolor sit amet cons</p>\r\n\r\n<p>Throughout our review process, we look at the design, features, battery life, spec, price and more for each smartwatch, rank it against the competition and enter it into the list you&#39;ll find below.</p>\r\n\r\n<p>&nbsp;</p>','\r',char(13)),'\n',char(10)));
